import React from "react";
import Navbar from "react-bootstrap/Navbar"
import Container from "react-bootstrap/Container"
import Jumbotron from "react-bootstrap/Jumbotron"

function Nav() {

    return(
    <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">
            <img
                alt="The Office Logo"
                src="https://d1yjjnpx0p53s8.cloudfront.net/styles/logo-thumbnail/s3/0018/0890/brand.gif?itok=h3ZAhbP2"
                width="30"
                height="30"
                className="d-inline-block align-top"
            />{' '}
      The Michael Scott Memory Game
    </Navbar.Brand>
    <Navbar.Text style = {{display: "inline-block", textAlign: "right"}}>Current Score: 0      High Score: 0 </Navbar.Text>
    </Navbar>
    )
}

export default Nav;
